import React from 'react';
import minutes from '../../assets/minutes.png';
import genres from '../../assets/genres.png';
import artist from '../../assets/artist.png';
import top from '../../assets/top.png';
import './music.css'

const Music = () => {
  return (
    <div className='music__content'>
        <div className='music__content-image'>
            <marquee className='music__content-image-scroll' scrollamount = "30">
                <img src={minutes} alt="minutes"/>
                <img src={genres} alt="genres"/>
                <img src={artist} alt="artist"/>
                <img src={top} alt="top"/>
            </marquee>
        </div>
    </div>
  )
}

export default Music
